import "fontsource-cascadia-mono";
import { Link, useNavigate } from "react-router-dom";

export default function Contact() {
    let navigate = useNavigate();
    return (
        <div>
            <Link to={`/home/Contact`}
            >CONTACT</Link>

        </div>
    )
}
